import React from 'react';
import { StyledContainer } from './styles';
  
type Props = {
    children: React.ReactNode;
    HeaderText: string;
    customstyle: string;
}
class Container extends React.Component<any, Props>{
    container = React.createRef<HTMLDivElement>();
    
    render(){
        return(
            <StyledContainer>
                {this.props.children}
            </StyledContainer>
        )
    }
}

export default Container;
